import NewsItem from '../components/NewsItem';
import fetch from 'isomorphic-unfetch'

import React from 'react'



function Api ({page,data}) {
    let arrv = [];
    console.log(data)
    console.log(page)
    for(let i of data.articles)
    {
        arrv.push(
         <NewsItem key={i.url} props = {i}/>
        )
    }
    return (
        <>
            <h2>NEWS</h2>
            {arrv}
        </>
    )
}
export default Api;
